import './Dashboard.css'; 
import "react-router-dom";
import { useHistory } from "react-router-dom"
import Register from './Register.js';

function App() { 
    const clickHandlerReg = () => {
        try {
            // await dispatch(action)
            props.history.push('/register')  // redirects
        } catch (err) {
        }
   }
    
        
    return ( 
    <div className="colored-background">
    <head> <link rel="stylesheet" href="https://fonts.cdnfonts.com/css/cowboys" /> 
    </head> 
    <body> 
    <h1 className="main-title">Outlaw Network</h1> 
    {/* Button container with space between buttons */} 
    <div className="button-container"> 
    <div>

        <button className="buttons" type="submit" onClick={clickHandlerReg}>Register</button> 
  
    </div>
    <button className="buttons" type="submit">Login</button> 
    </div> 
    </body> 
    </div> 
    ); 
} 

export default App;
